import {ReactComponent as Journey} from '../assets/Image_Exports/Our journey.png';
import {ReactComponent as BackgroundJourney} from '../assets/Image_Exports/';
export const Our_Clients = (props) => {
  return (
    <div id='our_clients' className='text-center'>
      <div className='container'>
        <div className='section-title'>
          <h2> Our Premium Clients</h2>
          <img src="./img/premium_clients.png" className="img-responsive" alt="" />{" "}
          <h2>Our Journey</h2>
          <div className= 'background-svg2 '> 
          <BackgroundJourney/>
          <div className = 'front-svg1'>
          < Journey/>
          </div>
          </div>
          {/* <img src="./img/Our journey.png" className="img-responsive" alt="" />{" "} */}
        </div>
       
      </div>
    </div>
  )
}
